const BoxComponent = (props) => {
    
    return (
        props.box.map((index , boxs) =>{
        
        return <div key={index} style={{background:box.color , display:'inline-block' , width:box.width+"px" , height:box.height+"px" , margin:"5px"}} >
          {box.color}
        </div>
        })
    )
}

export default BoxComponent
